import {srchConsultation} from './searchConsultation.js'

const objects = [
    {
      student: {
        name: 'Kouassi Anne Esther',
        school: 'ESCAE',
        class: 'ESCA',
        cycle: 'long',
        registration: '21INP00269'
      },
      consultation: {
        date: '12/05/2023 11:30:23',
        restDuration: 48,
        restEnd: '14/05/2023 11:30:23',
        diagnostic: JSON.stringify(['Djèkouadjo']) 
      }
    },
    {
      student: {
        name: 'John Doe',
        school: 'ABC School',
        class: 'Grade 10',
        cycle: 'long',
        registration: '21XYZ00123'
      },
      consultation: {
        date: '15/05/2023 09:45:00',
        restDuration: 0,
        restEnd: '16/05/2023 09:45:00',
        diagnostic: JSON.stringify(['Djèkouadjo']) 
      }
    },
    {
      student: {
        name: 'Alice Smith',
        school: 'XYZ School',
        class: 'Grade 8',
        cycle: 'court',
        registration: '21PQR00456'
      },
      consultation: {
        date: '18/05/2023 14:00:00',
        restDuration: 72,
        restEnd: '21/05/2023 14:00:00',
        diagnostic: JSON.stringify(['Djèkouadjo']) 
      }
    },
    {
      student: {
        name: 'Michael Brown',
        school: 'GHI School',
        class: 'Grade 9',
        cycle: 'long',
        registration: '21LMN00789',
      },
      consultation: {
        date: '29/05/2023 10:15:00',
        restDuration: 48,
        restEnd: '31/05/2023 10:15:00',
        diagnostic:JSON.stringify(['Djèkouadjo']) 
      }
    },
  ];
  
// const response = fetch('/api/user',{method:'GET'})
// if(response.ok){
    
  document.addEventListener('DOMContentLoaded',async (e)=>{
    const {userName, userEmail} = response.user

    document.querySelector('#userName').innerText = userName
    document.querySelector('#userEmail').innerText = userEmail
    const modal = document.querySelector('#modal')
    const mainContainer = document.querySelector('#mainContainer')
    let mainContainerChildren = []
    const add = document.querySelector('#add')
    const addTemplate = document.querySelector('#addModal')
    const seeMoreTemplate = document.querySelector('#addConsultation')
    const searchOption = document.querySelector('#searchOption')
    const searchStudentBtn = ''
    const searchConsultation = document.querySelector('#searchConsultation')
    const optionItem = Array.from(document.querySelectorAll('.optionItem')) 
    // const consultation = await fetch('/api/consultations',{method:'GET'})
    sessionStorage.setItem('consultations',JSON.stringify(objects))
    objects.forEach(object =>{
        import('./save.js')
        .then(({add})=>{
            add(object)
          mainContainerChildren = Array.from(mainContainer.children)
        })
    })
    modal.addEventListener('click',(e)=>{

        import('./showModal')
        .then(({hideDivWithOpacityAnimation})=>{
            hideDivWithOpacityAnimation()
        })
    })

    add.addEventListener('click',(e)=>{
        const temp = document.importNode(addTemplate.content, true)
        const tempChild = Array.from(temp.children)

        tempChild[0].addEventListener('click',(e)=>{
            e.stopPropagation()
        })

        tempChild[0].querySelector('#rest > input').addEventListener('change',(event)=>{
            if(event.target.checked){
                tempChild[0].querySelector('#number').classList.add('visible')
            }else{                
                tempChild[0].querySelector('#number').classList.remove('visible')
            }
        })

        tempChild[0].querySelector('#save').addEventListener('click',(e)=>{
            import('./save.js')
            .then(({save})=>{
              save(tempChild[0])
              mainContainerChildren = Array.from(mainContainer.children)
            })
        })
        import('./showModal')
        .then(({showDivWithOpacityAnimation})=>{
          showDivWithOpacityAnimation(tempChild[0])
        })
        
    })

    optionItem.forEach(option=>{
        option.addEventListener('click',(e)=>{
            console.log('first')
            if(e.target.classList.contains('actif')) return
            const old = e.target.parentElement.querySelector('.optionItem.actif')
            old.classList.remove('actif')
            e.target.classList.add('actif')
            import('./option.js')
            .then(({changeInput})=>{
                e.target.getAttribute('option') === '1'?changeInput(true):changeInput(false)
            })
        })
    })

    searchOption.addEventListener('mouseover',(e)=>{
        import('./showSearchOption.js')
        .then(({showSearchOption}) =>{
            showSearchOption(true)
            
        })
    })
    
    searchOption.addEventListener('mouseleave',(e)=>{
        import('./showSearchOption.js')
        .then(({showSearchOption}) =>{
            showSearchOption()           
        })
    })

    searchConsultation.addEventListener('input',(e)=>{

        const result = srchConsultation(e.target.value.trim())
        console.log(result)
        mainContainerChildren.forEach((child, index) =>{
            if(result.includes(index) === false){
                child.style.display = 'none'
            }else{
                if(child.style.display === 'none') {child.style.display = 'grid'}
            }
            
        })

    })
  })
// }
